import React from "react";

import './style.css'

const Product = ( props ) =>{

    const { title, label } = props

    console.log(label)

    return(<div>
        <div className="pro-label-title">
            <p>{title}</p>
        </div>
        <div className="pro-label-">
            {
                label && label.length > 0 ?
                label.map(el=>
                    <span key={el.id}>{el.label}</span>
                ):''
            }
        </div>
    </div>)
}

export default Product
